import React from 'react';
import '../styles/ServicesPage.css'; // Ensure this path is correct

const ServicesPage = () => {
  return (
    <div className="services">
      <h1>Our Services</h1>
      <div className="service">
        <h2>Real Estate</h2>
        <p>We provide a wide range of real estate services...</p>
      </div>
      <div className="service">
        <h2>Medical Vacation</h2>
        <p>Enjoy top-notch medical services combined with a vacation...</p>
      </div>
      <div className="service">
        <h2>Business Solutions</h2>
        <p>We offer various business solutions to help you succeed...</p>
      </div>
    </div>
  );
}

export default ServicesPage;
